Биография:
Родился 11 февраля 1976 года в с. Масы Ноокенского района Жалал-Абадской области.
Образование высшее. В 2003 году окончил Жалал-Абадский Коммерческий институт по специальности «Менеджер организации».
Трудовую деятельность в 1999 году начал инспектором отдела внешнего контроля налоговой инспекции Ноокенского района Жалал-Абадской области.
2000-2005гг.- главный бухгалтер кредитного союза «Айкыз» Ноокенского района;
2005-2006гг. - председатель крестьянского хозяйства «Токтомурад» Ноокенского района;
2006-2013гг.- эксперт по поддержке и развитию общин по Ноокенскому району и городам Майлуу - Суу и Таш – Кумыр, Агентство развития и  инвестирования сообществ Кыргызской Республики (АРИС);
2013-2015г.-координатор южного регионального представительства Агентства развития и инвестирования сообществ Кыргызской Республики (АРИС).    
Общественная деятельность:        
С 2004 по 2005гг. - депутат Ноокенского районного кенеша и Масынского местного кенеша, являлся постоянным членом комиссии "Сельское хозяйство, промышленность, транспорт и телекоммуникации";       
2008-2012гг. – депутат Масынского местного кенеша, являлся председателем комиссии "Бюджет и экономика";  
2012-2016гг. – депутат Масынского местного кенеша. Заместитель председателя Масынского айыльного кенеша.
Депутат Жогорку Кенеша Кыргызской Республики VI созыва от политической партии "Онугуу-Прогресс".
Депутат Жогорку Кенеша Кыргызской Республики VII созыва от политической партии "Ата-Журт Кыргызстан"
Женат, отец 5 детей.

Родился в 1970 году в городе Фрунзе.
Образование высшее. В 1989 году - окончил «зоотехническое» отделение Фрунзенского совхоз техникума, в 1998 году – окончил «сельскохозяйственный» факультет в Эгейском университете Турции, в 2004 году - окончил юридический факультет Кыргызского национального университета им. Ж.Баласагына.
Трудовую деятельность ьначал в 1989 году рабочим в совхозе «Тельман» Панфиловского района.
2000-2011гг. - основатель, генеральный директор туристической и логистической компании «Дискавери»;
2011-2012 гг. - заместитель генерального директора «Атриум Холдинг»;
2013-2021 гг. - генеральный директор компании ОсОО «Анилия»;
С 2019 года по декабрь 2021 года председатель Форума Кыргызско-Турецкой торгово-промышленной палаты, с 2019 года по декабрь 2021 года член Президиума Тюркской Торгово-промышленной палаты, кроме этого, с 2019 года по декабрь 2021 года являлся президентом Федерации «Эр Эниш» Кыргызской Республики.
На выборах 28 ноября 2021 года избран депутатом Жогорку Кенеша Кыргызской Республики VII созыва по Жайылскому одномандатному округу №22;
Женат, отец троих детей

Родился 27 ноября 1974 года в г. Айдаркен Кадамжайского района Баткенской области.
Имеет высшее образование.
В 1997 году поступил в Кыргызский государственный университет строительства, транспорта и архитектуры.
С 2006 по 2008 годы работал в Министерстве внутренних дел Кыргызской Республики;
С 2009 по 2020 годы занимался предпринимательской деятельностью;
В 2021 году был избран депутатом Жогорку Кенеша Кыргызской Республики VII созыва по Кадамжайскому избирательному округу №3;
Женат, отец четверых детей.

Родился 27 октября 1977 года в городе Бишкек.
Образование: высшее:
В 1998 году окончил Международный Университет Кыргызстана по специальности «Международные отношения».
В 2001 году стал магистром по специальности «Юриспруденция», Международный Университет Кыргызстана.
В 2017 году окончил аспирантуру Кыргызско-Российского Славянского Университета имени Б.Н.Ельцина.
Трудовая деятельность:
1998–2005 гг. — Министерство иностранных дел Кыргызской Республики, Главное управление СНГ, атташе, третий секретарь, второй секретарь, первый секретарь;
2005–2008 гг. — Посольство Кыргызской Республики в Республике Узбекистан, первый секретарь; Временно поверенный в делах КР в РУз;
2008-2008 гг. — Отдел многостороннего сотрудничества Департамента СНГ Министерства иностранных дел КР, заведующий;
2008–2010 гг. — Посольство Кыргызской Республики в Туркменистане, Советник;
01.2011-04.2011 гг. — Отдел внешних связей и протокола Аппарата Президента Кыргызской Республики, эксперт;
04.2011-12.2011 гг. — Отдел внешних связей и протокола Аппарата Президента Кыргызской Республики, заместитель заведующего;
2012–2016 гг. — Отдел международных связей и протокола Аппарата Жогорку Кенеша Кыргызской Республики, заведующий;
04.2016-10.2018 гг. — Чрезвычайный и Полномочный Посол Кыргызской Республики в Японии;
17 октября 2018 года – 14 октября 2020 года министр иностранных дел Кыргызской Республики.
Дипломатический ранг: «Чрезвычайный и Полномочный Посланник Кыргызской Республики»
Классный чин: Государственный советник государственной службы 3 класса
В 2021 году был избран депутатом Жогорку Кенеша Кыргызской Республики VII созыва от политической партии «Альянс».
В марте 2022 года был избран Председателем Комитета по международным делам, обороне, безопасности и миграции Жогорку Кенеша Кыргызской Республики.
Женат, отец четверых детей.

Родилась 16 июня в 1991 году в г.Ноокат Ошской области в семье служащих;
Имеет высшее образование;
В 2013 году окончила Кыргызско-Российский Славянский университет им.Б.Н.Ельцина экономический факультет по специальности “Финансы и кредит”;
В 2018 году окончила в Дипломатическую академию им.К.Дикамбаева  при МИД КР на факультет международные отношения;
Трудовая деятельность началась в 2016 году. Работала в Национальном Статистическом комитете Кыргызской Республики в Главном вычислительном центре, ведущим экономистом;
В 2018 году работала в Агентстве развития и инвестирования сообществ Кыргызской Республики (АРИС) в отделе по связям с общественностью – специалистом по механизму обратной связи;
В 2021 году была избрана депутатом Жогорку Кенеша Кыргызской Республики VII созыва от политической партии «Альянс»;
Замужем, мать двоих детей.

Родился 28 июня 1979 года в селе Учар Кара-Сууйского района.
Имеет высшее образование: Ошский Технологический Университет, факультет "Юриспруденция" (1996-2001гг.).
2014-2017гг. - Ошский Государственный Университет, факультет: ИПК "Финансы и кредит"
Опыт работы:
2007 г. – директор ДЮСШ №2 г.Ош при Спорткомитета;
2010 г. – директор школы бокса и тяжелой атлетики;
2011 г. - директор Дирекции парковок, автостоянок и автогаражей;
2012 г. - руководитель МП «Ош-Тазалык» при мэрии г.Ош;
2013-2014 гг. - директор Агентства  пассажирского транспорта;
2010-2012 гг. - депутат Ошского городского кенеша;
2012-2015 гг. - депутат Ошского городского кенеша;
С 2018г. - главный тренер спортиного клуба «ЕREM» г.Бишкек.
 Достижения в спорте:
2010, 2016, 2019гг.  - «Лучший тренер года» КР;
2015 г. - серебряный призер «Кубка Мира» WAKO РФ г. Анапа;
2008 г. - отличник физической культуры и спорта КР;
2006 г. - чемпион мира по кикбоксингу (WFK);
2005г. - «Лучший спортсмен года» Ошской области;
2004г.  - серебряный призер «Чемпионата Азии» (WAKO);
2003г. -  чемпион Спартакиады КР по боксу;
2003-2008 г. - «VI-кратный Чемпион КР по кикбоксингу»;
2000-2010 гг. - «Чемпион Международных турниров» (Украина, Марокко, Россия, Казахстан, Узбекистан, Корея);
 Воспитал многих мастеров спорта КР международного класса (по боксу и кикбоксингу).
Государственные и ведомственные награды:
2004 год - Почетная грамота Мэрии г.Ош (С.Чырмашев);
2005 год - Почетная грамота Ошской областной администрации (А.Артыков);
2006 год - «Человек года» Кара-Суйского района (М. Жумабеков);
2006-2008 гг. - Почетная грамота мэрии г.Ош (Ж.Исаков);
2008 год - Почетная грамота ГорОНО г.Ош (А.Балтабаев);
2008 год - Почетная грамота Агентство ФКиСпорту при ПКР (Б.Асанов);
2008 год - отличник физической культуры КР (Приказ №321);
2009 год  - Почетная грамота Агентство ФК и Спорту при ПКР (Приказ №85) (А.Воинов);
2009 год  - Почетная грамота Ошской области администрации за вклад в развитии молодежной политики (приказ №609) (М.Бакиров);
2010 год  - Почетная грамота Агентсво ФКИ спорту при ПКР (Приказ №212-0) ( А.Касенов);
2011 год - Почетная грамота от Духовного Управление Мусульман Кыргызстана (Азирети муфтий Чубак ажы Жалилов);
2012 год - Почетная грамота мэрии г.Ош Приказ №304 (М. Мырзакматов);
2014 год  - Почетная грамота Министерство образование и науки КР ( К.Садыков);
2014 год - Почетная грамота Ошского городского Кенеша Приказ №103 (У.Примов).

Родился  3-марта  1988 года в г.Ош, Ошской области.
Образование высшее.
В 2016 году окончил Ошский государственный университет по направлению “Экономика” и получил степень бакалавра.
В 2018 году окончил Академию Государственного Управления при Президенте Кыргызской Республики по направлению  «Государственное и муниципальное управление», была присвоена степень магистра.
Трудовая деятельность: 
2006 -2018 гг. -  менеджер ОсОО ТД «Бакай-Юг»;
2008 -2013 гг. - директор ОсОО ТД «Бакай-Юг»;
2013 -2017 гг. - директор АОЗТ «Ак-Кайын»;
2016 год - директор ОФБ “Айбек Алимжанов”;
С ноября 2021 года депутат Жогорку Кенеша Кыргызской Республики VII созыва.
Женат, отец троих детей.

Родился 13 июля в 1984 году в Нарынской области;
Имеет два высших образования.
В 2007 году окончил инженерный факультет Джалал-Абадского государственного университета по специальности инженер-энергетик;
В 2012 году окончил магистратуру в Кыргызской государственной юридической академии по направлению «Юриспруденция»;
С 2004 года по 2021 год занимался частным предпринимательством;
В 2021 году избран депутатом Жогорку Кенеша Кыргызской Республики VII созыва по Нарынскому избирательному округу;
Женат, отец шестерых детей.

Родился 19 марта 1974 года в селе Таш-Кудук Бакай-Атинского района Таласской области. Образование высшее;
В 2007 году поступил в Кыргызский Государственный технический университет им. И. Раззакова, в 2013 году успешно окончил университет получив специальность инженера-механика;
В 2016 году окончил юридический факультет Кыргызского Национального университета им. Ж. Баласагына;
В 1993-1994 годах служил в Армии Кыргызской Республики;
В 2005-2010 годах работал ОАО «Ак-Жолтой»;
В 2010-2011 годах работал ведущим специалистом отдела ОДТН и ОПСМ Управления городского транспорта мэрии г.Бишкека;
В 2011-2013 годах работал заместителем директора ОсОО «АИИД-Сервис»;
В 2013-2015 годах работал заместителем начальника муниципального территориального управления Ленинского района мэрии г. Бишкек;
В 2016-2017 годах работал депутатом Бишкекского городского кенеша XXVI созыва;
В 2017-2021 годах работал депутатом Бишкекского городского кенеша XXVII созыва, в 2018 году избран заместителем председателя Бишкекского городского кенеша;
В 2021 году избран депутатом Жогорку Кенеша Кыргызской Республики VII созыва по списку политической партии «Ишеним».
Женат, имеет трех дочерей и сына.

Родился 27 мая 1958 года в селе Караван Жаӊы-Ноокатского района Ошской области.
В 1975 году окончил среднюю школу имени Жоомарта Боконбаева в городе Баткен.
Образование высшее:
В 1983 году окончил Рижский Краснознаменный институт инженеров гражданской авиации имени Ленинского комсомола по специальности эксплуатация летательных аппаратов и двигателей, присвоена квалификация инженер-механик;
В 1988 году окончил высшие курсы КГБ СССР в г.Киеве;
1999-2002 годы окончил Кыргызский Государственный Национальный университет, по специальности «Финансы и кредит»;
Трудовая деятельность: 
1983-1987 годы – инженер технического отдела Фрунзенского объединенного отряда аэропорта «Манас»;
1987-1993 годы - служба в органах национальной безопасности Кыргызской Республики, г.Бишкек - оперуполномоченный, старший оперуполномоченный, начальник отдела;
1993-1994 годы – Национальная авиакомпания «Кыргызстан аба жолдору», помощник президента, начальник отдела авиационной безопасности;
1995-1997 годы - Акционерно-коммерческий банк «Кыргыз Жери», советник Председателя;
1997-1998 годы - Национальная авиакомпания «Кыргызстан аба жолдору», помощник Президента по авиационной безопасности;
21.03.2000-2.10.2000 г. – советник, пресс-секретарь главы государственной администрации Баткенской области – губернатора;
2000-2001 годы – начальник отдела промышленности, строительства и коммуникации аппарата государственной администрации Баткенской области;
2001-2004 годы – генеральный директор аэропорта «Баткен» г.Баткен;
2004-2004 годы –заместитель начальника финансово-экономического отдела Баткенского упарвления водного хозяйства;
2005-2008 годы – глава государственной администрации Баткенской области - губернатор;
2008-2010 годы – советник Президента Кыргызской Республики;
2010-2010-годы – заместитель главы государственной администрации Баткенской области-губернатора;
2010-2011 годы - глава государственной администрации Баткенской области-губернатор;
2011-2011 годы советник Президента Кыргызской Республики;
В 2021 году избран депутатом Жогорку Кенеша Кыргызской Республики VII созыва от политической партии «Ыйман Нуру».
Женат, имеет 3 детей.

Родился 26 марта 1968 года в селе Тельман Кара-Сууйского района, Ошской области.
В 1986 году окончил среднюю школу в селе Тельман.
1986-1988 гг. - служил в Демократической Республике Афганистан в рядах Советской Армии.
В 1988-1993 гг. – окончил  Кыргызский Государственный Университет по специальности «Бухгалтерский учет, контроль и анализ хозяйственной деятельности».
Трудовая деятельность: 
1993 г. –товаровед Карасуйского потребобщества;
1996-2020гг. – работа в органах таможенной службы Кыргызской Республики;
04.2022г. – депутат Жогорку Кенеша Кыргызской Республики VII созыва от политической партии «Ата-Журт Кыргызстан».
Награды: 
Почетная грамота ГТС КР; 
Медаль «За службу в таможенных органах» III степени;
Медаль «За службу в таможенных органах» II степени;
Медаль «За службу в таможенных органах» I степени;
«Отличник таможенной службы Кыргызской Республики».

Родился 16 октября 1974 года в с. Кызыл-Сенир Сузакского района Жалал-Абадской области.
Образование высшее. В 1996 году  окончил Кыргызскую Государственную Академию Физический культуры и Спорта по специальности “Преподаватель - тренер”.
 В 2010 году окончил Кыргызскую Государственную  Юридическую Академию при Правительстве Кыргызской Республики по специальности  “Юриспруденция”.
 В 2019 году получил степень магистра по направлению «Международные отношения» в Дипломатической Академии Министерства Иностранных дел Кыргызской Республики имени К.Дикамбаева.

Трудовую деятельность начал в 1998 году преподавателем физкультуры в филиале Кыргызского Государственного  института физической культуры и спорта Жалал-Абадской области.
В 2000-2007 годы индивидуальный предприниматель;
С 2007 по 2010 год – председатель общественного фонда “Элдик чындык”; 
В 2010-2011 годы – представитель Торгово-промышленной палаты Кыргызской Республики в Китайской Народной Республике;
В 2011-2012 годы – советник Генерального директора Государственной дирекции по восстановлению и развитию городов Ош и Жалал-Абад;
В 2015 году избран депутатом Жогорку Кенеша Кыргызской Республики VI созыва от партии “Өнүгүү-Прогресс” ;
С 2015 по июнь 2021 года  - Заместитель председателя Комитета по
социальным вопросам, образованию, науке, культуре и здравоохранению Жогорку КенешаКыргызской Республики;
С июня 2021 года –Председатель комитета по международным делам,
обороне и безопасности Жогорку КенешаКыргызской Республики.
В ноябре 2021 года был избран депутатом Жогорку Кенеша Кыргызской Республики VII созыва по Сузакскому одномандатному округу №13.
Член комитета по транспорту, коммуникациям, архитектуре и строительству Жогорку Кенеша Кыргызской Республики.
 
Награды: 
-Диплом Министерства молодежи, труда и занятости Кыргызской Республики;
-Почетная грамота Министерства образования Кыогызской Республики;
-Почётная грамота Жогорку Кенеша Кыргызской Республики;
-Почётная грамота Правительства Кыргызской Республики;
- Почётная грамота Государственного агентства по делам молодежи, физической культуры и спорта при Правительстве Кыргызской Республики;
- Почётная грамота Сузакского районного отдела образования;
-Является почетным гражданином Сузакского района;
-Является почетным гражданином Кызыл-Тууйского айыл окмоту;
-Государственный советник государственной службы 3 класса.
-Мастер спорта Кыргызской Республики международного класса по греко-римской борьбе.
-Женат, пятеро детей.

Родился 12 марта 1982 года в городе Фрунзе.
Имеет высшее юридическое и высшее экономическое образование. В 2006 году с отличием окончил Академию МВД им. генерал-майора Э.Алиева по специальности “Юриспруденция”. В 2003 году углубленно изучал английский язык в “Princess college” (Лондон, Великобритания). В 2012-2016 годы обучался на экономическом факультете в Кыргызском Национальном Аграрном Университете им.Скрябина по специальности “Финансы и кредит”. В 2020 году поступил на магистратуру в Кыргызский Национальный Аграрный Университет им.Скрябина по специальности “Экология и природопользование”;
Трудовая деятельность:
2007-2010 гг.  - Следственное Управление Государственной службы финансовой полиции Кыргызской Республики, следователь;
2010-2011 гг. - Главное Управление внутренних дел Чуйской области, начальник отдела по борьбе с экономической преступностью и коррупцией;
02.2011-09.2011 гг. - Главное Управление внутренних дел Чуйской области, начальник отдела по борьбе с организованной преступностью и коррупцией;
2011-2012 гг. - Аппарат Президента Кыргызской Республики, заместитель заведующего отделом по работе с обращениями граждан;
07.2012-11.2012 гг. - Аппарат Правительства Кыргызской Республики, инспектор отдела обороны, правопорядка и чрезвычайных ситуаций;
2014-2015 гг. - Управление Государственной службы по борьбе с экономическими преступлениями при Правительстве Кыргызской Республики по Чуйской и Таласской областям, и.о. начальника Управления;
2015-2016 гг. - Управление Государственной службы по борьбе с экономическими преступлениями при Правительстве Кыргызской Республики по Чуйской области, заместитель начальника Управления;
2016-2018 гг. - Управление Государственной службы по борьбе с экономическими преступлениями при Правительстве Кыргызской Республики по г.Бишкек, заместитель начальника Управления – начальник отдела по экономическим преступлениям.
2018-10.2020 гг. - Заместитель председателя Государственной службы по борьбе с экономическими преступлениями при Правительстве Кыргызской Республики.
В феврале 2022 года избран депутатом Жогорку Кенеша Кыргызской Республики VII созыва от политической партии «Альянс».
Женат, воспитывает троих детей.

Родился в 1967 году 23-июня в селе Грозное Кара-Бууринского района Таласской области;
С 1985г по 1987г служил в рядях Советской Армии. В 1987-1989 гг учился во Фрунзенском Кооперативном Техникуме по специальности «Заготовитель»;
С 1989 года по 1992 год работал в заготовительной конторе Чуйской области;
С 1992 года по 2007 год занимался частной предпринимательской деятельностью в Кара-Бууринском районе Таласской области;
2007-2015гг - директор в строительной компании ОсОО «Курулуш-Арсенал БМ";
2009 – 2012 гг -  избран депутатом Кара-Бууринского районного кенеша Таласской области;
2012 год -  депутат Таласского городского кенеша Таласской области;
2015м год -  кандидат в депутаты Жогорку Кенеш Кыргызской Республики;
С 2016 года по 2017 год  являлся начальником Таласского областного Управления капитального строительства при ДЖГС;
В 2017 году был назначен Полномочным представителем Правительства Кыргызской Республики в Таласской области и занимал эту должность до октября месяца 2020 года;
В ноябре 2021 года избран депутатом VII созыва Жогорку Кенеша Кыргызской Республики от политической партии «Ишеним»;
Женат. Отец трех дочек и одного сына

Родился в 1981 году в пгт Шамалды-Сай, г. Таш-Комур. По национальности кыргыз.

Высшее образование. В 2003 году окончил Джалал-Абадский коммерческий институт по специальности «экономист».

В 2003 году работал в многоотраслевом производственно-сельскохозяйственном кооперативе «Азиз КД»;

В 2007 году эксперт кредитного отдела Джалал-Абадского филиала «Инэксимбанка»;

В 2008 году начальник сберегательной кассы «БТА Банк» Шамалды-Сай № 42;

Депутат сельского совета в 2013 году;

Депутат сельсовета второй раз в 2016 году;

С 24 декабря 2013 года - глава айыл окмоту Достук, в 2016 году избран главой айыл окмоту на второй срок, в 2021 году третий раз избран главой айыл окмоту

Женатый. Имеет 3 сыновей и 1 дочь.

Родился 7 сентября 1979 года в селе М.Баетово Ак-Талинского района Нарынской области;
Имеет высшее образование.
В 2001 году окончил Кыргызский технический университет имени И. Раззакова по специальности  «инженер-энергетик».
В 2018  году окончил Кыргызскую государственную юридическую академию.
С 2001-2002 гг.  - коммунальное предприятие ОсОО «ЖЭУ №12», мастер по производству. 
С 2002-2003 гг.  - коммунальное предприятие ОсОО «ЖЭУ №4», мастер по производству.  
С 2003 -2006 гг.  - инженер, главный инженер строительной фирмы ОсОО «Чындоо».  
С 2006 -2008 гг.  - главный энергетик компании ОсОО «Интер Альянс».
С 2008 -2011 гг.  - технический директор строительной компании «Профит Экспресс».     
В 2021 году был избран депутатом Жогорку Кенеша Кыргызской Республики VII созыва от политической партии «Ынтымак».
Председатель Комитета по транспорту, коммуникациям, архитектуре и строительству;
 Награды:
Почетная грамота Жогорку Кенеша  (2018г.);
Почетная грамота Аппарата Правительства КР (2020г.);
Почетная грамота Полномочного Представителя ПКР в Нарынской области (2018г.);
Почетная грамота ГААС и ЖКХ при Правительстве КР  (2019г.);
Почетная грамота ДЖГС ГААС и ЖКХ при Правительстве КР (2018г.);
Почетная грамота Академии Управления при Президенте КР (2012г.);
Почетная грамота Мэра г. Бишкек  (2011г.);
Почетная грамота Мэра г. Бишкек (2016г.);
Почетная грамота Мэра г. Бишкек  (2017г.);
Почетная грамота УКС мэрии г. Бишкек  (2013г.);
Почетная грамота УВД Нарынской области   (2021г.);
Нагрудной знак  "Ардактуу Автотранспортчу"  Министерство Транспорта и коммуникаций Кыргызской Республики  (2022г.);
Почетный гражданин Нарынской области.
Женат, отец четверых детей.

Родилась 19 июля 1977 года в поселке Кировка Кировского района Таласской области;
В 1995 году поступила в Кыргызский Государственный Национальный Университет и по окончанию университета получила специальность «банковское дело» по направлению финансы и кредит в 2000 году;
В 2013 году на базе высшего первого образования Кыргызкого национального университета им. Ж. Баласагына присвоена квалификация «юрист», по специальности «юриспруденция»;
1998-2005 г.г.- главный бухгалтер и специалист по кадрам ОКХ «Тынай – Ата»;
2005-2009 г.г.- бухгалтер БУГХ «Бишкекгаз»;
2009-2011 г.г.- специалист, ведущий специалист, главный бухгалтер отдела учета АУР ОАО «Азия Универсал Банк»;
2011 г. - главный специалист управления бухгалтерского учета и отчетности ОАО «ФинансКредитБанк КАБ»;
2011-2014 г.г. - главный бухгалтер ОсОО «АзияТрансИнвест»;
2014-2019 г.г. - эксперт Центра судебного представительства Правительства Кыргызской Республики;
2019 г. – по ноябрь 2021 г. - заместитель директора Центра судебного представительства Правительства Кыргызской Республики;
В 2021 году избрана депутатом Жогорку Кенеша Кыргызской Республики VII созыва от политической партии «Ата-Журт Кыргызстан».
Замужем, мать пятерых детей.

Родился 2 июля 1976 года;
В 1991 году окончил школу №67 в Бишкеке;
С 1991 по 1995 г.г. обучался и окончил Бишкекский архитектурно-строительный техникум;
С 1996  по 1998 г.г. обучался и окончил Кыргызский Государственный Университет Строительства, Транспорта и Архитектуры по специальности  «инженер-строитель»;
С 2006 по 2008 г.г. обучался в Академии управления при президенте КР по специальности  «Управление бизнесом». В том же году учился и прошёл стажировку по программе Invent (немецкая программа по развитию малого и среднего бизнеса). Стажировку проходил в Германии;
С 1999 по 2000 г.г. был инженером-конструктором третьей категории;
С 2000 по 2001г.г. работал слесарем второй категории и слесарем на сборочных работах;
С 2002 по 2003 г.г. работал инженером-конструктором в ОсОО «Асанда»;
С 2003 по 2004 г.г. был руководителем отдела рекламы и продаж кыргызско-турецкого совместного предприятия ОсОО «Автомаш-Экол»;
С 2005 по 2007 г.г. работал финансовым аналитиком в финансово-бухгалтерском отделе предприятия «Кыргызавтомаш»;
С 2007 по 2021 г.г. являлся частным предпринимателем, соучредителем и руководителем ОсОО «Автомаш-Энерго»;
С 2004 по 2010 г.г. был членом политической партии «СДПК»;
С  июня 2019 года по февраль 2021 года был лидером политической партии «Социал-Демократы»;
В ноябре 2021 года избран депутатом Жогорку Кенеша Кыргызской Республики;
Женат, воспитывает 2 сыновей.

Родился в 21 апреля 1991 года в селе Кожо-Арык Ноокатского района, Ошской области;
Имеет высшее образование. В 2008 году поступил в Ошский государственный Юридический Институт (ОшГЮИ), факультет «Управления и права»;
2014-2015 годы — начальник участка ОсОО "Дастан Курулуш";
с июня по ноябрь 2015 года — технический директор ОсОО "Дастан Курулуш";
2015-2016 годы — генеральный директор ОсОО "Дастан Курулуш";
2016-2017 годы — учредитель, генеральный директор ОсОО "Тагай Ата";
2017-2018 годы — генеральный директор ОсОО "Эмаком";
2018-2021 годы — президент холдинга ОсОО "Эмаком Холдинг";
В 2021 году был избран депутатом Жогорку Кенеша Кыргызской Республики VII созыва от политической партии «Ишеним»;
Женат, отец 3 детей.
